  \"rxclass\",\n\t\"isopen\": false,\n\t\"url\": null,\n\t\"notes\": \"<p>The RxClass
  Browser is a web application for exploring and navigating through the class hierarchies
  to find the RxNorm drug members associated with each class.</p>n<p>RxClass links
  drug classes of several drug sources including ATC, MeSH, NDF-RT and FDA/SPL to
  their RxNorm drug members (ingredients, precise ingredients and multiple ingredients).</p>n<p>RxClass
  allows users to search by class name or identifier to find the RxNorm drug members
  or, conversely, search by RxNorm drug name or identifier to find the classes that
  the RxNorm drug is a member of.</p>n\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
